import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <Link to="/">Home</Link>

      <div className="navbar-links">
        <div className="navbar-link">
          <Link to="/search">Search</Link>
        </div>
        <div className="navbar-link">
          <Link to="/data">Data</Link>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
